import React from 'react';
import { Link } from 'react-router-dom';

export function About(){
    return (
        <div>
            <Link to="/About">About</Link>
            <h1>Hey everyone</h1>
        </div>
    )
}

export function Profile(){
    return (
        <div>
            This is my profile
        </div>
    )
}

function Home(){
    return (
        <div>
            <h1>Home</h1>
        </div>
    )
}


export function App(){
    return (
        <div>
            <Home />
        </div>
    )
}
